import React from 'react';
import {
  MDBCarousel,
  MDBCarouselItem,
} from 'mdb-react-ui-kit';
import Search from './Search';



export default function Home() {
  return (
    <div>
    <MDBCarousel showIndicators showControls fade  >
      <MDBCarouselItem

        style={{height :"380px", width :"100%"}}
        itemId={1}
        src='https://cdn.propertyupdate.com.au/wp-content/uploads/2022/08/rent-pro-800x450.jpg'
        alt='...'
      >
      </MDBCarouselItem>

      <MDBCarouselItem
        style={{height :"380px", width :"100%"}}
        itemId={2}
        src='https://image-cdn.carrot.com/uploads/sites/69435/2023/01/hd-wallpaper-g871b7a599_1920-1920x800.jpg'
        alt='...'
      >

      </MDBCarouselItem>

      <MDBCarouselItem
        style={{height :"380px", width :"100%"}}
        itemId={3}
        src='https://www.nerdwallet.com/ca/wp-content/uploads/sites/2/2021/11/GettyImages-1279432485-e1635950557247-770x320.jpg'
        alt='...'
      >

      </MDBCarouselItem>
    </MDBCarousel>
    <br />

    <h2 style={{color :'#3b71ca' , marginLeft:"15px" }}>Real estate</h2>
    <Search />
    </div>
  );
}
